pragma solidity ^0.8;

contract testHash{
    uint public a;
    function add(uint b) public {
        a+=b;
    }
    // 下面两种写法是效果是一样的  
    bytes4 public selector = this.add.selector;
    bytes4 public genSelector = bytes4(keccak256("add(uint256)"));
    bool public isequal = (selector==genSelector);
}

